// import React from 'react';
// import {DropdownItem} from './ProgramLists'
// import './ProgramsDropdown.css'

import React, { Component } from 'react';
import ProgramsList from "../ProgramsList"; 
import "./Programs.css"

class Programs extends Component {
	render() {
		return (
            <div className="container">
                {
					ProgramsList.ProgramsList.map((program, i) => {
						return (
							<div key={i} >
								<div className = "ProgramsList-box" >
									<a href={program.url} >
                                        <img src={program.ProgramLogo} alt={program.ProgramName} />

									</a>
									<div>
										<div>
											<a href={program.url}>{program.ProgramName}</a>
										</div>
											{program.ProgramDescription.map(function (role, i) { 
												return <div key={i}>
													<p>{role.description}</p>
												</div>
											})}
									</div>
								</div>
							</div>
						);
					})
				}
            </div>
        );
    }
} 
export default Programs;
